import React from "react";
import {Button, Modal, ModalBody, ModalFooter, ModalHeader, Table} from "reactstrap";
import {Edit, Trash2} from 'react-feather';
import Translate from "../../../Translate";
import UserModal from "./positionModal";

const UserTable = (props) => {

    function toggle(type,id) {
        // props.userModal(type,!props.modal[type])
        if(id){
            props.getPositions(id)
        }
    }
    function handleClick() {
        props.deleteUser(props.user.id)
    }

    if (props.positions.length) {
        return (
            <Table responsive>
                <thead>
                <tr>
                    {Object.keys(props.positions[0]).map((key) => <td key={key}><Translate name={key}/></td>)}
                    <th>Actions</th>
                </tr>
                </thead>
                <tbody>
                {props.positions.map((value, index) =>
                    <tr key={index}>
                        {Object.keys(value).map((key) => <td key={key}>{value[key]}</td>)}
                        <td>
                            <Edit size={18} className="mr-2" onClick={() => toggle("edit",value['id'])}/>
                            <Trash2 size={18} color="#FF586B" onClick={() => toggle("delete",value['id'])}/>
                        </td>
                    </tr>
                )}
                </tbody>
                {/*<Modal isOpen={props.modal.edit} toggle={()=>toggle("edit")}  size="md">*/}
                {/*    <ModalHeader toggle={()=>toggle("edit")}><Translate name="editContact"/></ModalHeader>*/}
                {/*    <UserModal {...props}/>*/}
                {/*</Modal>*/}
                {/*<Modal isOpen={props.modal.delete} toggle={()=>toggle("delete")}  size="md">*/}
                {/*    <ModalHeader toggle={()=>toggle("delete")}><Translate name="deleteContact"/></ModalHeader>*/}
                {/*    <ModalBody>Դուք համոզված ե՞ք ջնջել</ModalBody>*/}
                {/*    <ModalFooter>*/}
                {/*        <Button color="primary" type="submit" onClick={handleClick}>*/}
                {/*            <Translate name="confirm"/>*/}
                {/*        </Button>*/}
                {/*    </ModalFooter>*/}
                {/*</Modal>*/}
            </Table>

        );
    } else {
        return (
            <div></div>
        )
    }
}
export default UserTable;
